float lenVec2(vec2 vec){
    return pow(pow(vec.x, 2.0) + pow(vec.y, 2.0), 0.5);
}


vec4 elipse(vec2 uv, vec2 pos,vec2 scale,vec4 color, vec4 fragColor){
    uv -= pos;
    uv.x /= scale.x;
    uv.y /= scale.y;
    if (lenVec2(uv) < 1.0){
        return color;
    }
    return fragColor;
}


void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;

    // Time varying pixel color
    vec4 color = vec4((sin(((uv.x+uv.y)*2.0 + sin(iTime))*10.0))*0.7,0.0,(sin(((uv.x+uv.y)*2.0 + sin(iTime) )*10.0)),1.0);
    // Output to screen
    //fragColor = color;

    fragColor = elipse(uv, vec2(0.61 + abs(cos(iTime*5.0)/100.0),0.2), vec2((450.0/800.0)*0.15, 0.15), color, fragColor);

    fragColor = elipse(uv, vec2(0.39- abs(cos(iTime*5.0)/100.0),0.2 ), vec2((450.0/800.0)*0.15, 0.15), color, fragColor);

    fragColor = elipse(uv, vec2(0.5,0.6- abs(cos(iTime*5.0)/100.0)), vec2(0.1, 0.35), color, fragColor);

    fragColor = elipse(uv, vec2(0.5 + sin(iTime*10.0)/10.0*(450.0/800.0), 0.5 + cos(iTime*10.0) / 10.0), vec2((450.0/800.0)*0.1, 0.1), vec4(1.0,1.0,1.0,1.0), fragColor); 
    fragColor = elipse(uv, vec2(-0.1 + mod(iTime / 2.0, 1.2), 0.5 + cos(iTime*3.0)/3.0 ), vec2((450.0/800.0)*0.1, 0.1), vec4(1.0,0.0,1.0,1.0), fragColor); 
}
